Are you or the person you care for over 70, self-isolating or are medically vulnerable?

@ManCityCouncil's Covid-19 Community Response Hub can help with delivery of food &amp; medication, combating loneliness &amp; more. 

Call 0800 234 6123, text 07860 022 876 or

Need help with recovery? Phoenix Futures Detox and Residential Services are Covid-safe, open and accepting admissions for the winter period. Contact us here to find out more or make a referral - 

https://t.co/NDQTfyBtXn

@PhoenixFutures1 #recovery #rehabilitation

Health &amp; Fitness Supervisor, Leeni, shares some great advice on choosing the best type of physical activity to improve #mentalhealth

If you'd like more guidance on staying active during #lockdown, get in touch with us &amp; we'd be happy to help! fitness@essex.ac.uk

